query events ( $limit:Int $from:Int $accountID:ID! $timeFrame:TimeFrame! $eventsMeasure:[EventsMeasure] $eventsDimension:[EventsDimension] $eventsFilter:[EventsFilter!] $eventsSort:[EventsSort!] ) {
	events ( accountID:$accountID timeFrame:$timeFrame measures:$eventsMeasure dimensions:$eventsDimension filters:$eventsFilter sort:$eventsSort ) {
		id 
		from 
		to 
		total 
		totals 
		records ( limit:$limit  from:$from  )  {
			fieldsEventsRecord: fields {
				name 
				value 
			}
			fieldsUnitTypesEventsRecord: fieldsUnitTypes
			fieldsMap
			trends
			prevTimeFrame
			flatFields
		}

	}	
}
